  const { repository } = await graphql(
    `
      {
        repository(owner: "octokit", name: "graphql.js") {
          issues(last: 3) {
            edges {
              node {
                title
              }
            }
          }
        }
      }
    `,
    {
      headers: {
        authorization: `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`,
      },
    }
  );
  await console.log(repository);
  return (
    <div className="App">
      {repository}
    </div>
  );
}

export default App;
